import React, { useEffect } from "react";

function Account() {
  useEffect(() => {
    fetch("/pledges", {
      method: "POST",
    })
      .then((response) => response.json())
      .then((data) => {
        setPledges(data);
      })
      .catch((error) => {
        console.log(error);
      });
  });
  return (
    <>
      <h2></h2>
      <p>All encompassing app for students at UC Davis to meet and connect.</p>
      <p>Sign In now with your UC Davis email to see what it is about!</p>
    </>
  );
}
export default Account;
